/**
 * Embedded starter font data for the FontPlugin.
 * Contains FiraCode (monospace) and FiraSans (sans-serif) as WOFF2 data URIs.
 * Tree-shakeable: only imported when used.
 */

import type { FontDefinition } from './FontPlugin.js';

export const FIRA_CODE_WOFF2_DATA: string =
	'data:font/woff2;base64,';

export const FIRA_SANS_WOFF2_DATA: string =
	'data:font/woff2;base64,';

/** Fira Code  a monospace font with programming ligatures. */
export const FIRA_CODE: FontDefinition = {
	name: 'Fira Code',
	family: "'Fira Code', monospace",
	category: 'monospace',
	fontFaces: [
		{
			src: `url(${FIRA_CODE_WOFF2_DATA}) format('woff2')`,
			weight: '400',
			style: 'normal',
		},
	],
};

/** Fira Sans  a humanist sans-serif typeface. */
export const FIRA_SANS: FontDefinition = {
	name: 'Fira Sans',
	family: "'Fira Sans', sans-serif",
	category: 'sans-serif',
	fontFaces: [
		{
			src: `url(${FIRA_SANS_WOFF2_DATA}) format('woff2')`,
			weight: '400',
			style: 'normal',
		},
	],
};

/** All starter fonts bundled with notectl. */
export const STARTER_FONTS: readonly FontDefinition[] = [FIRA_SANS, FIRA_CODE];
